Object.Field:
BEGIN
EXECUTE IMMEDIATE 'ALTER SESSION SET NLS_DATE_FORMAT = "YYYY-MM-DD HH24:MI:SS"';
MERGE INTO OPR_CHANGE_MANAGEMENT_DTLS F_TAB USING ( SELECT * FROM STG_OPR_CHANGE_MANAGEMENT_DTLS WHERE (CR_NUMBER,LAST_UPDATED) IN (SELECT CR_NUMBER,MAX(LAST_UPDATED) FROM STG_OPR_CHANGE_MANAGEMENT_DTLS GROUP BY CR_NUMBER) ) STG_TAB ON (F_TAB.CR_NUMBER = STG_TAB.CR_NUMBER) WHEN MATCHED THEN UPDATE SET F_TAB.PRIORITY = STG_TAB.PRIORITY, F_TAB.CHANGE_TYPE = STG_TAB.CHANGE_TYPE, F_TAB.CREATED = TO_DATE(TRIM(STG_TAB.CREATED)), F_TAB.CREATED_DT = TO_DATE(SUBSTR(TRIM(STG_TAB.CREATED_DT),0,10)), F_TAB.STATE = STG_TAB.STATE, F_TAB.CHANGE_OWNER = STG_TAB.CHANGE_OWNER, F_TAB.CHANGE_OWNING_GROUP = STG_TAB.CHANGE_OWNING_GROUP, F_TAB.CI = STG_TAB.CI, F_TAB.SHORT_DESCRIPTION = STG_TAB.SHORT_DESCRIPTION, F_TAB.LAST_UPDATED = TO_DATE(TRIM(STG_TAB.LAST_UPDATED)), F_TAB.PLANNED_START_DATE = TO_DATE(TRIM(STG_TAB.PLANNED_START_DATE)), F_TAB.PLANNED_END_DATE = TO_DATE(TRIM(STG_TAB.PLANNED_END_DATE)), F_TAB.ACTUAL_START = TO_DATE(TRIM(STG_TAB.ACTUAL_START)), F_TAB.ACTUAL_END = TO_DATE(TRIM(STG_TAB.ACTUAL_END)), F_TAB.CLOSED = TO_DATE(TRIM(STG_TAB.CLOSED)), F_TAB.SOURCE_OF_CHANGE = STG_TAB.SOURCE_OF_CHANGE, F_TAB.SOURCE_RELEASE = STG_TAB.SOURCE_RELEASE, F_TAB.SOURCE_PROBLEM = STG_TAB.SOURCE_PROBLEM, F_TAB.SOURCE_REQUEST = STG_TAB.SOURCE_REQUEST, F_TAB.SOURCE_INCIDENT = STG_TAB.SOURCE_INCIDENT, F_TAB.SLA_DUE = TO_DATE(TRIM(STG_TAB.SLA_DUE)) WHERE TO_DATE(TRIM(STG_TAB.LAST_UPDATED)) > F_TAB.LAST_UPDATED WHEN NOT MATCHED THEN INSERT ( F_TAB.CR_NUMBER, F_TAB.PRIORITY, F_TAB.CHANGE_TYPE, F_TAB.CREATED, F_TAB.CREATED_DT, F_TAB.STATE, F_TAB.CHANGE_OWNER, F_TAB.CHANGE_OWNING_GROUP, F_TAB.CI, F_TAB.SHORT_DESCRIPTION, F_TAB.LAST_UPDATED, F_TAB.PLANNED_START_DATE, F_TAB.PLANNED_END_DATE, F_TAB.ACTUAL_START, F_TAB.ACTUAL_END, F_TAB.CLOSED, F_TAB.SOURCE_OF_CHANGE, F_TAB.SOURCE_RELEASE, F_TAB.SOURCE_PROBLEM, F_TAB.SOURCE_REQUEST, F_TAB.SOURCE_INCIDENT, F_TAB.SLA_DUE ) VALUES ( STG_TAB.CR_NUMBER, STG_TAB.PRIORITY, STG_TAB.CHANGE_TYPE, TO_DATE(TRIM(STG_TAB.CREATED)), TO_DATE(SUBSTR(TRIM(STG_TAB.CREATED_DT),0,10)), STG_TAB.STATE, STG_TAB.CHANGE_OWNER, STG_TAB.CHANGE_OWNING_GROUP, STG_TAB.CI, STG_TAB.SHORT_DESCRIPTION, TO_DATE(TRIM(STG_TAB.LAST_UPDATED)), TO_DATE(TRIM(STG_TAB.PLANNED_START_DATE)), TO_DATE(TRIM(STG_TAB.PLANNED_END_DATE)), TO_DATE(TRIM(STG_TAB.ACTUAL_START)), TO_DATE(TRIM(STG_TAB.ACTUAL_END)), TO_DATE(TRIM(STG_TAB.CLOSED)), STG_TAB.SOURCE_OF_CHANGE, STG_TAB.SOURCE_RELEASE, STG_TAB.SOURCE_PROBLEM, STG_TAB.SOURCE_REQUEST, STG_TAB.SOURCE_INCIDENT, TO_DATE(TRIM(STG_TAB.SLA_DUE)) ); END;
